import React, { useEffect, useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import "../App.css"
import { getDataClient } from '../redux/actions/actions'


function NavBar() {
    return (
        <nav className="navbar navbar-light bg-primary">
            <div className="container-fluid">
                <a className="navbar-brand text-light mx-4">Navbar</a>
                <form className="d-flex mx-4">
                    <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
                    <button className="btn btn-outline-light" type="submit">Search</button>
                </form>
            </div>
        </nav>
    )
}

function Cards({ state }) {


    return (
        <div>
            {state.map(card => { return(

                <div>
                    <div class="card" >
                        <div class="card-header">{card.entreprise}</div>
                        <img src={card.picture} class="card-img-top" alt="..." />
                        <div class="card-body">
                            <h5 class="card-title">{card.userName}</h5>
                            <p class="card-text">{card.pays + "," + card.ville + "," + card.address}</p>
                            <a href="#" class="btn btn-primary">Go somewhere</a>
                        </div>
                    </div>
                </div>
            )

            }
            )
        }
            
        </div>
    )
}

export default function AutClient() {
    const [array, setArray] = useState([])
    const dispatch = useDispatch()
    const state = useSelector(state => state.getDataForClient)

    useEffect(async () => {
        if (dispatch(getDataClient()))
            await setArray(state)
    }, [])

    return (
        <div>
            <NavBar />
            <Cards state={array} />
        </div>
    )
}
